    return (
        <header className='header'>
            <h1 style = {{color: "gold"}}>E</h1>
            <h1 style = {{color: "white"}}>-Sports-</h1>
            <h1 style = {{color: "gold"}}>Harmony</h1>
            <Button color='#00000F' text={showAdd ? 'Close' : 'Create Account'} onClick={onAdd} />
        </header>
    )
}

export default Header;

